import React from 'react';
import { ExampEProps } from './ExampE.propTypes';
import {
    Card, CardImg, CardText, CardBody,
    CardTitle, CardSubtitle, Button
  } from 'reactstrap';


  // RecipeListItem renders a bootstrap list item containing data from the recipe api call
 export function TripCard({
        title,
        location,
        description,
        date,
        image
  }) {
    return (
        <div>
        <Card>
          <CardImg top width="100%" src={image} alt="Card image cap" />
          <CardBody>
            <CardTitle>Title: {title}</CardTitle>
            <CardSubtitle>Location: {location}</CardSubtitle>
            <CardText>Description:{description}</CardText>
            <CardText>Date:{date}</CardText>
          </CardBody>
        </Card>
      </div>
    );
  }

// ExampE.propTypes = ExampEProps.propTypes;
// ExampE.defaultProps = ExampEProps.defaultProps;

export default TripCard;
